import { UserService } from './../registration/user.service';
import { Component, OnInit } from '@angular/core';
import { ToastrService } from 'ngx-toastr';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-certificate',
  templateUrl: './certificate.component.html',
  styleUrls: ['./certificate.component.css']
})
export class CertificateComponent implements OnInit {
  public loading = false;
  fullname;
  auth;
  documentDefinition;
  today = new Date()

  constructor(private userService: UserService, private toastr: ToastrService) { }

  ngOnInit() {
    this.loading = true;

    this.auth = {
      id: '',
      first_name: '',
      surname: '',
      last_name: '',
      town: '',
      state_of_origin: '',
      local_government_area: '',
      currentDate: this.today.toLocaleDateString("en-US"),
    }
    this.userService.getUser().subscribe(
      data => {
        this.auth.first_name = data.first_name;
        this.auth.id = data.id;
        this.auth.surname = data.surname;
        this.auth.last_name = data.last_name;
        this.auth.town = data.town;
        this.auth.state_of_origin = data.state_of_origin;
        this.auth.local_government_area = data.local_government_area;
        this.loading = false;
        this.toastr.success("Your certificate has been successfully generated")

      },
      err => {
        this.toastr.error("Your certificate has failed to generate")
        this.loading = false;

      }
    );
  }
  generatePdf() {
    this.fullname = `${this.auth.surname} ${this.auth.first_name} ${this.auth.last_name}`

    this.documentDefinition = {
      pageSize: {
        width: 1000,
        height: 730
      },
      pageMargins: [0, 0, 0, 0],
      content: [
        {
          image: "data:image/png;base64,",
          width: 1000,
          height: 730,
          margin: [0, 0, 0, 0]
        },
        {
          text: this.fullname.toUpperCase(),
          bold: true,
          fontSize: 30,
          color: '#494e63',
          uppercase: true,
          absolutePosition: { x: 260, y: 330 }
        },
        {
          text: `${this.auth.state_of_origin}`,
          bold: true,
          fontSize: 20,
          color: '#494e63',
          uppercase: true,
          absolutePosition: { x: 105, y: 460 }
        },
        {
          text: `${this.auth.local_government_area}`,
          bold: true,
          fontSize: 20,
          color: '#494e63',
          uppercase: true,
          absolutePosition: { x: 420, y: 460 }
        },
        {
          text: `${this.auth.town}`,
          bold: true,
          fontSize: 20,
          color: '#494e63',
          uppercase: true,
          absolutePosition: { x: 750, y: 460 }
        },
        {
          text: `${this.auth.currentDate}`,
          bold: true,
          fontSize: 20,
          color: '#494e63',
          uppercase: true,
          absolutePosition: { x: 270, y: 600 }
        },
        {
          text: `${this.auth.id}`,
          bold: true,
          fontSize: 20,
          color: '#494e63',
          uppercase: true,
          absolutePosition: { x: 500, y: 702 }
        }
      ]
    };
    pdfMake.createPdf(this.documentDefinition).download('OHANAEZE-NDIGBO-WORLDWIDE.pdf');
  }


}
